<ul>
<li><strong><code>models</code> 目录:</strong> 通常用于定义与数据库表或业务实体一一对应的模型类。这些类通常包含与业务逻辑相关的所有属性和方法。</li>
<li><strong><code>dto</code> 目录:</strong> 通常用于定义用于数据传输的对象。这些类通常只包含数据本身，不包含任何业务逻辑。</li>
</ul>
